import React, {Component} from 'react';
import Radium from 'radium'

import Parantheses from './parantheses.svg';

const styles = {
  fullStack: {
    height: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  left: {
    position: 'relative',
    width: '50vw',
    height: '100%',
    display: 'flex',
    alignItems: 'center',
  },
  right: {
    width: '50vw',

  },
  fullstackTitle: {
    marginTop: 0,
    fontSize: 42,
    fontWeight: 300,
    letterSpacing: 1,
    fontFamily: 'brandon-grotesque,Helvetica Neue,Helvetica,Arial',
  },
  fullstackTitleSpan: {
    fontWeight: 600,
    marginLeft: 10,
  },
  parantheses: {
    position: 'absolute',
    right: 150,
    width: 200,
  },
  fullstackContent: {
    fontFamily: '微軟正黑體',
    width: 400,
  }

}

class MainFullstack extends Component {

  render() { 
    return (
      <section id ="mainFullStack" style={styles.fullStack}>
        <div style={styles.left}>
          <img style={ styles.parantheses} src={Parantheses} alt=""/>
        </div>
        <div style={styles.right}>
          <h2 style={styles.fullstackTitle}>FULL-STACK<span style={styles.fullstackTitleSpan}>DEV</span></h2>
          <p style={styles.fullstackContent}>講一些我會的東東，例如react, redux, 串接api(啊雖然還不會後端但先寫全端就對ㄖ）然後再搭配個個性積極、學習力強、擅長團隊合作......描述自己像個優秀青年這樣。啊希望將來可以用英文打比較潮。</p>
        </div>
      </section>
    )
  }
}


export default Radium(MainFullstack)
